import './App.css';

const Hello = () => { 
  return (
    <div>
      <p>Hello world</p>
    </div>
    )
}

const App = () => {
  return (
    <>
      <h1>Greetings</h1>
      <Hello /> 
    </>  
  )
}

export default App;
